import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
  return (
    <div className="container">
      <Header />
      <Main />
      <Skills />
    </div>
  );
}

function Header() {
  return <H imgName="/me.jpg" name="Vishal Kumar Singh" />;
}

function H(props) {
  return (
    <div className="header">
      <img className="image" src={props.imgName} alt={props.name}></img>
      <h1>{props.name}</h1>
    </div>
  );
}

function Main() {
  return (
    <div className="main">
      I am a passionate B.Tech student with a strong interest in web development
      and software engineering. Proficient in JavaScript, React, and modern web
      technologies, I enjoy building interactive and user-friendly applications.
      I have experience working with APIs, optimizing performance, and creating
      intuitive user interfaces. Always eager to learn and explore new
      technologies, I strive to develop efficient and innovative solutions. My
      goal is to continuously grow as a developer and contribute to meaningful
      projects that make a difference.
    </div>
  );
}

function Skills() {
  return (
    <div className="skills">
      <Skill skill="HTML + CSS" emoji="✌️" />
      <Skill skill="JavaScript" emoji="✌️" />
      <Skill skill="" emoji="✌️" />
      <Skill skill="HTML + CSS" emoji="✌️" />
      <Skill skill="HTML + CSS" emoji="✌️" />
      <Skill skill="HTML + CSS" emoji="✌️" />
    </div>
  );
}

function Skill(props) {
  return (
    <div className="skill">
      <span>{props.skill}</span>
      <span>{props.emoji}</span>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <StrictMode>
    <App />
  </StrictMode>
);
